import React, { Component } from "react";
import socket from "../socket";

class App extends Component {
  state = { client: socket() };

  onSendMessage() {
    this.state.client.message;
  }

  render() {
    return (
      <div className="App">
        <h1>Hello Chat</h1>
        <button onClick={this.onSendMessage}>Send Message</button>
      </div>
    );
  }
}

export default App;
